DoctorAdventures - Dani Jensen - Special Treatment

Dr. Dani hates to give bad news. She says the worst part of her job is to tell a patient that he is going to die soon. She just can't handle it. The only thing she can do to ease the pain of her patients is to give them some &quot;special treatment.&quot;

